{"cells":[{"source":"<a href=\"https://www.kaggle.com/code/khaitlinbernaldez/bellabeat-fitness-case-study?scriptVersionId=92026763\" target=\"_blank\"><img align=\"left\" alt=\"Kaggle\" title=\"Open in Kaggle\" src=\"https://kaggle.com/static/images/open-in-kaggle.svg\"></a>","metadata":{},"cell_type":"markdown","outputs":[],"execution_count":0},{"attachments":{"9f5ef598-9791-4e15-b2a7-a374e29fa538.png":{"image/png":""}},"cell_type":"markdown","id":"d589f0ea","metadata":{"papermill":{"duration":0.317427,"end_time":"2022-04-03T23:35:46.77573","exception":false,"start_time":"2022-04-03T23:35:46.458303","status":"completed"},"tags":[]},"source":["![bellabeat_logo.png](attachment:9f5ef598-9791-4e15-b2a7-a374e29fa538.png)"]},{"cell_type":"markdown","id":"b2d69ac8","metadata":{"papermill":{"duration":0.317514,"end_time":"2022-04-03T23:35:47.409652","exception":false,"start_time":"2022-04-03T23:35:47.092138","status":"completed"},"tags":[]},"source":["# Summary\n","Bellabeat, a high-tech company focused on developing health-focused technology for women, is emerging as a large competitor in the global smart device market. The executive team asked the data analytics team to investigate user experiences with other smart devices to gain insights on what marketing strategies the company can implement to continue to grow as a global competitor.  \n","\n","\n","# Ask\n","### Business Task\n","Our main objective is to gain insight into how consumers use non-Bellabeat smart devices to influence Bellabeat's current marketing strategy. We will use the following questions to guide our analysis:\n","* What are some trends in smart device usage?\n","* How could these trends apply to Bellabeat customers?\n","* How could these trends help influence Bellabeat marketing strategy?\n","\n","### Stakeholders\n","Our main stakeholders are Bellabeat's cofounders, Urka Sren and Sando Mur, and Bellabeat's executive team. We will also be communicating our findings to Bellabeat's marketing analytics team.\n","\n","\n","# Prepare\n","### Data Source\n","The data provided to us by Bellabeat's cofounder is the FitBit Fitness Tracker Dataset, which is a public domain made available through Mobius. The dataset is also avaiable on Kaggle: https://kaggle.com/arashnic/fitbit\n","\n","\n","### Data Integrity\n","We will verify the integrity of our dataset using the ROCCC approach:\n","#### __Reliability__\n","Our dataset includes user data from 30 individuals. According to the Central Limit Theorem, a sample size of 30 is the smallest sample size where average results represent the average population. Therefore, we can confindently apply insights gained in our analysis to the average population of FitBit users.\n","\n","However, our dataset does not include any demographic information. Therefore, we cannot generalize our findings to be representative of female smart technology users, which is the target audience for Bellabeat.\n","\n","#### __Original__\n","Personal tracker data was collected from thirty FitBit users via a survey distributed by Amazon Mechanical Turk between 03/12/2016-05/12/2016.\n","\n","#### __Comprehensive__\n","This dataset contains 18 csv files, which include minute-level output for physical activity, heart rate, weight, and sleep monitoring data for 30 individuals over a span of two months. \n","\n","A more in depth outline of our data:\n","* Daily activity\n","* Calories burned (daily, hourly, by minute)\n","* Intensities (daily, hourly, by minute)\n","* Steps (daily, hourly)\n","* Heart rate\n","* METs\n","* Sleep (by day and duration recorded as minutes)\n","* Weight log information\n","\n","#### __Current__\n","The dataset is not current, as it was collected in 2016, therefore user trends may differ. However, we can still use insights to guide our understanding of usage trends.\n","\n","#### __Cited__\n","Furberg, Robert; Brinton, Julia' Keating, Michael; Ortiz, Alexa https://zenodo.org/record/53894#.Yg6vfBPMK3J\n","\n","# Process\n","For this data analysis, I will be using R due to the size of the datasets, as well as the ability to create data visualizations. This will allow me to summarize and share my insights with key stakeholders.\n","\n","## Installing Packages\n","To begin processing the FitBit dataset, we will first install and open needed packages.\n"]},{"cell_type":"code","execution_count":1,"id":"5a633712","metadata":{"_kg_hide-output":true,"execution":{"iopub.execute_input":"2022-04-03T23:35:48.047437Z","iopub.status.busy":"2022-04-03T23:35:48.04397Z","iopub.status.idle":"2022-04-03T23:35:49.520449Z","shell.execute_reply":"2022-04-03T23:35:49.519031Z"},"papermill":{"duration":1.798232,"end_time":"2022-04-03T23:35:49.520671","exception":false,"start_time":"2022-04-03T23:35:47.722439","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":[" \u001b[1mAttaching packages\u001b[22m  tidyverse 1.3.1 \n","\n","\u001b[32m\u001b[39m \u001b[34mggplot2\u001b[39m 3.3.5     \u001b[32m\u001b[39m \u001b[34mpurrr  \u001b[39m 0.3.4\n","\u001b[32m\u001b[39m \u001b[34mtibble \u001b[39m 3.1.5     \u001b[32m\u001b[39m \u001b[34mdplyr  \u001b[39m 1.0.7\n","\u001b[32m\u001b[39m \u001b[34mtidyr  \u001b[39m 1.1.4     \u001b[32m\u001b[39m \u001b[34mstringr\u001b[39m 1.4.0\n","\u001b[32m\u001b[39m \u001b[34mreadr  \u001b[39m 2.0.2     \u001b[32m\u001b[39m \u001b[34mforcats\u001b[39m 0.5.1\n","\n"," \u001b[1mConflicts\u001b[22m  tidyverse_conflicts() \n","\u001b[31m\u001b[39m \u001b[34mdplyr\u001b[39m::\u001b[32mfilter()\u001b[39m masks \u001b[34mstats\u001b[39m::filter()\n","\u001b[31m\u001b[39m \u001b[34mdplyr\u001b[39m::\u001b[32mlag()\u001b[39m    masks \u001b[34mstats\u001b[39m::lag()\n","\n","here() starts at /kaggle/working\n","\n","\n","Attaching package: janitor\n","\n","\n","The following objects are masked from package:stats:\n","\n","    chisq.test, fisher.test\n","\n","\n","\n","Attaching package: lubridate\n","\n","\n","The following objects are masked from package:base:\n","\n","    date, intersect, setdiff, union\n","\n","\n"]}],"source":["library(tidyverse)\n","library(here)\n","library(skimr)\n","library(janitor)\n","library(dplyr)\n","library(lubridate)\n","library(ggplot2)"]},{"cell_type":"markdown","id":"8eba404d","metadata":{"papermill":{"duration":0.322662,"end_time":"2022-04-03T23:35:50.168423","exception":false,"start_time":"2022-04-03T23:35:49.845761","status":"completed"},"tags":[]},"source":["## Importing Datasets\n","For this analysis, we will be focusing on three categories of data: activity (daily and hourly), sleep, and weight. Activity data includes information about the intensity of user activity, steps taken, and calories burned.\n","\n"]},{"cell_type":"code","execution_count":2,"id":"899ad990","metadata":{"_kg_hide-output":true,"execution":{"iopub.execute_input":"2022-04-03T23:35:50.85077Z","iopub.status.busy":"2022-04-03T23:35:50.816918Z","iopub.status.idle":"2022-04-03T23:35:51.491087Z","shell.execute_reply":"2022-04-03T23:35:51.489083Z"},"papermill":{"duration":1.001031,"end_time":"2022-04-03T23:35:51.491254","exception":false,"start_time":"2022-04-03T23:35:50.490223","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["\u001b[1m\u001b[1mRows: \u001b[1m\u001b[22m\u001b[34m\u001b[34m940\u001b[34m\u001b[39m \u001b[1m\u001b[1mColumns: \u001b[1m\u001b[22m\u001b[34m\u001b[34m15\u001b[34m\u001b[39m\n","\n","\u001b[36m\u001b[39m \u001b[1m\u001b[1mColumn specification\u001b[1m\u001b[22m \u001b[36m\u001b[39m\n","\u001b[1mDelimiter:\u001b[22m \",\"\n","\u001b[31mchr\u001b[39m  (1): ActivityDate\n","\u001b[32mdbl\u001b[39m (14): Id, TotalSteps, TotalDistance, TrackerDistance, LoggedActivitiesDi...\n","\n","\n","\u001b[36m\u001b[39m Use \u001b[30m\u001b[47m\u001b[30m\u001b[47m`spec()`\u001b[47m\u001b[30m\u001b[49m\u001b[39m to retrieve the full column specification for this data.\n","\u001b[36m\u001b[39m Specify the column types or set \u001b[30m\u001b[47m\u001b[30m\u001b[47m`