9.282822Z","iopub.status.idle":"2022-04-03T23:36:19.301795Z","shell.execute_reply":"2022-04-03T23:36:19.300071Z"},"papermill":{"duration":0.410422,"end_time":"2022-04-03T23:36:19.301962","exception":false,"start_time":"2022-04-03T23:36:18.89154","status":"completed"},"tags":[]},"outputs":[],"source":["merged_data <- merged_data %>% mutate(TotalActiveMinutes = VeryActiveMinutes + FairlyActiveMinutes + LightlyActiveMinutes)"]},{"cell_type":"markdown","id":"0344bdb2","metadata":{"papermill":{"duration":0.386991,"end_time":"2022-04-03T23:36:20.071636","exception":false,"start_time":"2022-04-03T23:36:19.684645","status":"completed"},"tags":[]},"source":["We would also like to gain insight into how often the participants use their FitBit. We will add a column named \"TotalUsage\" which will include a sum of users' total active and sedentary minutes."]},{"cell_type":"code","execution_count":21,"id":"d742ff62","metadata":{"execution":{"iopub.execute_input":"2022-04-03T23:36:20.848178Z","iopub.status.busy":"2022-04-03T23:36:20.846516Z","iopub.status.idle":"2022-04-03T23:36:20.864402Z","shell.execute_reply":"2022-04-03T23:36:20.862785Z"},"papermill":{"duration":0.404178,"end_time":"2022-04-03T23:36:20.86458","exception":false,"start_time":"2022-04-03T23:36:20.460402","status":"completed"},"tags":[]},"outputs":[],"source":["merged_data <- merged_data %>% mutate(TotalUsage = TotalActiveMinutes + SedentaryMinutes)"]},{"cell_type":"markdown","id":"1f60523b","metadata":{"papermill":{"duration":0.387742,"end_time":"2022-04-03T23:36:21.637764","exception":false,"start_time":"2022-04-03T23:36:21.250022","status":"completed"},"tags":[]},"source":["#### Sleep\n","Another variable we could consider is sleep latency, which is the amount of time it takes for a user to fall asleep. We will create a new column calculating this value."]},{"cell_type":"code","execution_count":22,"id":"064895fc","metadata":{"execution":{"iopub.execute_input":"2022-04-03T23:36:22.417098Z","iopub.status.busy":"2