veMinutes), mean(merged_data_clean$LightlyActiveMinutes), mean(merged_data_clean$AwakeSedentaryMinutes), mean(merged_data_clean$TotalMinutesAsleep))\n","Activity <- c(\"Very Active\", \"Fairly Active\", \"Lightly Active\", \"Sedentary\", \"Asleep\")\n","average_activity <- data.frame(Activity, Average)"]},{"cell_type":"markdown","id":"87691fc2","metadata":{"papermill":{"duration":0.414563,"end_time":"2022-04-03T23:37:03.800091","exception":false,"start_time":"2022-04-03T23:37:03.385528","status":"completed"},"tags":[]},"source":["Then, we use these averages to calculate percentagtes of each category, which is summarized in a second data frame (average_activity_percentage)."]},{"cell_type":"code","execution_count":44,"id":"e0588e95","metadata":{"execution":{"iopub.execute_input":"2022-04-03T23:37:04.635618Z","iopub.status.busy":"2022-04-03T23:37:04.634072Z","iopub.status.idle":"2022-04-03T23:37:04.658016Z","shell.execute_reply":"2022-04-03T23:37:04.656621Z"},"papermill":{"duration":0.442024,"end_time":"2022-04-03T23:37:04.658151","exception":false,"start_time":"2022-04-03T23:37:04.216127","status":"completed"},"tags":[]},"outputs":[],"source":["average_activity_percentage <- average_activity %>% \n","  mutate(totals = sum(Average)) %>% \n","  group_by(Activity) %>% \n","  summarize(Percentage = Average / totals) %>% \n","  mutate(labels = scales::percent(Percentage))"]},{"cell_type":"markdown","id":"87ec1ae4","metadata":{"papermill":{"duration":0.41523,"end_time":"2022-04-03T23:37:05.491927","exception":false,"start_time":"2022-04-03T23:37:05.076697","status":"completed"},"tags":[]},"source":["Pie chart visualizing distribution of user activity during FitBit usage:"]},{"cell_type":"code","execution_count":45,"id":"0ddfd6df","metadata":{"execution":{"iopub.execute_input":"2022-04-03T23:37:06.329357Z","iopub.status.busy":"2022-04-03T23:37:06.327643Z","iopub.status.idle":"2022-04-03T23:37:06.640833Z","shell.execute_reply":"2022-04-03T23:37:06.641304Z"},"papermill":{"dur