) + \n","  labs(title = \"Active Minutes vs. Sleep Latency\", x = \"Total Active Minutes\", y = \"Sleep Latency\")"]},{"cell_type":"markdown","id":"28550408","metadata":{"papermill":{"duration":0.455292,"end_time":"2022-04-03T23:37:51.211835","exception":false,"start_time":"2022-04-03T23:37:50.756543","status":"completed"},"tags":[]},"source":["There is no correlation between the total active minutes of a participant and how long it takes for them to fall asleep."]},{"cell_type":"markdown","id":"c5a636bb","metadata":{"papermill":{"duration":0.455605,"end_time":"2022-04-03T23:37:52.119542","exception":false,"start_time":"2022-04-03T23:37:51.663937","status":"completed"},"tags":[]},"source":["# Act\n","The dataset we used for our analysis contains a few limitations, including a small sample size and lack of demographic information. This poses us at a risk for sampling bias. To improve our response to Bellabeat's business task, we suggest conducting a further data analysis using Bellabeat's current users, as well as users from other smart device companies (AppleWatch, new model of FitBit, etc.). A larger sample size would not only provide a higher level of confidence, but also a lower margin of error and a greater statistical significance. This will also allow us to curate our analysis to young and adult women, which is the primary focus for Bellabeat's technology.\n","\n","With that being said, we have taken these limitations into account and identified notable trends that could be a target of interest for Bellabeat's marketing team:\n","* High usage drops significantly when comparing total user usage and users that utilize the sleep feature. In addition, usage for the FitBit dips during certain times of the week and as the study prolonged. Two variables that could impact the variation in usage is the battery life of the device and uncomfortability of wearing the FitBit, most notably during sleep.\n","    + Actionable step: Emphasize the __battery life__ and __wearability__ of Beallbeat's _Leaf_ and _Ivy_.\n","\n","\n","* Users are most active during 12:00 pm-2:00 pm and 5:00 pm-7:00 pm. In addition, users are also most active on Tuesday's and Saturday's, and least active on Sunday's.\n","    + Actionable step: Bellabeat's _Wellness Coach_ paried with __notifications__ is a great way to keep users motivated and active. Bellabeat could __send users a notification during these times and days__ to suggest workouts via the _Wellness Coach_ and remind users to stay active.\n","    + Actionable step: In addition, Bellbeat could also __target the days that users are least active__. Notifications could remind users to move their body and suggest short, easy-to-do workouts via the _Wellness Coach_.\n","    \n","    \n","* On average, users get less than 7 hours of sleep, with Tuesday's, Thursday's, and Friday's being the days users get the least amount of sleep. The CDC recommends that adults (aged 18-60 years old) get 7 or more hours of sleep per night.\n","    + Actionable step: To improve sleep duration, Bellabeat could __send reminders__ for users to participate in _guided meditations_ and listen to _deep sleep sounds_, which are included features in the app."]}],"metadata":{"kernelspec":{"display_name":"R","language":"R","name":"ir"},"language_info":{"codemirror_mode":"r","file_extension":".r","mimetype":"text/x-r-source","name":"R","pygments_lexer":"r","version":"4.0.5"},"papermill":{"default_parameters":{},"duration":129.930347,"end_time":"2022-04-03T23:37:52.684099","environment_variables":{},"exception":null,"input_path":"__notebook__.ipynb","output_path":"__notebook__.ipynb","parameters":{},"start_time":"2022-04-03T23:35:42.753752","version":"2.3.3"}},"nbformat":4,"nbformat_minor":5}